import React, { Component } from 'react';
import { withRouter } from 'react-router-dom'
import ProtoShell from './Elements/Shell';
import ProtoNav from './Elements/SideNav';
import ProtoTableView from './Elements/TableView';
import ProtoHeader from './Elements/Breadcrumb';

import "./Proto1.scss";


class Proto1 extends Component {

    render() {
        return (
            <div id="proto1">
                <ProtoShell></ProtoShell>
                <div className="Container">
                    <div className="Container-body">
                        <div className="Container-content">
                            <h1>Proto1</h1>
                            <ProtoHeader></ProtoHeader>
                            <ProtoTableView></ProtoTableView>
                        </div>
                        <nav className="Container-nav"><ProtoNav></ProtoNav></nav>
                        <aside className="Container-rRail">adsadsadsadsadsadsadsadsadsadsadsadsadsadsadsadsads</aside>
                    </div>
                </div>
            </div>
        )
    }

    constructor() {
        super();
    }

    componentDidMount() {
        const convertToSpan = (oldElement)=>{
            // oldElement.innerHTML.replace(/<a/gi, "<span");
            console.log(oldElement);
            // let newElem = oldElement.cloneNode(true);
            oldElement.outerHtml.replace(/<a/g, "<span");
            // oldElement.parentNode.replaceChild(newElem, oldElement);
        }
        setTimeout(() => {
            console.log(this)
            console.log('this')
            let getErrthang = document.getElementById('proto1');
            let gotit= getErrthang.cloneNode(true);
            let theBody = document.getElementById('proto1');
            theBody.parentNode.replaceChild(gotit , theBody);
            console.log(document.getElementsByTagName('a'));
            let getAllLinks = document.getElementsByTagName('a');
            Array.from(getAllLinks).forEach(
                (el) => {
                    convertToSpan(el);
                }
            )

        },800)
    }



}
export default Proto1;
